import React from 'react';

const Home = () => {
    return(
        <>
        <div>
        <div style={{ marginTop: '-45px'}} className="d-flex w-100 vh-100 align-items-center justify-content-center">
            <h1>Hi Friends Good Evening!</h1>
        </div>
        </div>
        </>
    )
}

export default Home;
